(function(){
  var document = stm_document;
  var typeAssoc = document.assocs["lecm-contract:typeContract-assoc"];
  if (typeAssoc) {
      var documentTypeDictionary = typeAssoc[0];
        var isEsRequired = documentTypeDictionary.properties["lecm-doc-dic-dt:es-sign-required"] === true;
      document.properties["lecm-signing-v2-aspects:isESSigningRequired"] = isEsRequired;
      if (isEsRequired) {
        document.addAspect("lecm-signed-docflow:work-with-es-files-aspect");
      }
      document.save();
  }
})();

